var d3 = require("d3")

var TableBar = (props) => {
    return (
      <table className ="table">
        <tbody>
          {
            props.rows !== undefined ? props.rows.map((row, i) =>
              <tr key = {"row"+i}>
              {
               props.rows !== undefined ?  props.cols.map((col, i) =>
                  <td key = {col}>{row[col]}  </td>
                  ) : null
              }
              </tr>
              ) : null
          }
        </tbody>

      </table>
      )
   }

export default TableBar
